<font size=4 color="#0000ff">【主な特長】</font><BR>
<font size=2>
<font color="green"><b>1.優れた熱伝導と美しさを誇る本格3層構造の「ラゴプラン」底面</b></font><BR>
底面は熱伝導に優れたアルミニウムの上下を、<bR>
耐久性に優れた美しい輝きを持つ18-10ステンレス鋼と、<br>
18-0ステンレス鋼で挟んだ本格3層構造。<bR>
均一な熱伝導で、すばやくおいしく調理します。<bR>
<font color="green"><b>2.伝統と信頼のブランドならでは25年保障</b></font><BR>
皆様に長く安心して使っていただけるように、<bR>
ラゴスティーナの製品は25年保証です。<bR>
※フライパンのふっ素樹脂コーティングは除く<bR>
<font color="green"><b>3.メテオライト・ファイブスターコーティング</b></font><BR>
フライパンには4層のふっ素樹脂コーティングが付いて<bR>
こびりつきにくく、お手入れが簡単です。<bR>
<BR>
